      string: '{"info":{"author":"Tom Christie","author_email":"tom@tomchristie.com","bugtrack_url":null,"classifiers":["Development
        Status :: 5 - Production/Stable","Environment :: Web Environment","Framework
        :: Django","Framework :: Django :: 3.0","Framework :: Django :: 3.1","Framework
        :: Django :: 3.2","Framework :: Django :: 4.0","Framework :: Django :: 4.1","Intended
        Audience :: Developers","License :: OSI Approved :: BSD License","Operating
        System :: OS Independent","Programming Language :: Python","Programming Language
        :: Python :: 3","Programming Language :: Python :: 3 :: Only","Programming
        Language :: Python :: 3.10","Programming Language :: Python :: 3.6","Programming
        Language :: Python :: 3.7","Programming Language :: Python :: 3.8","Programming
        Language :: Python :: 3.9","Topic :: Internet :: WWW/HTTP"],"description":"#
        [Django REST framework][docs]\n\n[![build-status-image]][build-status]\n[![coverage-status-image]][codecov]\n[![pypi-version]][pypi]\n\n**Awesome
        web-browsable Web APIs.**\n\nFull documentation for the project is available
        at [https://www.django-rest-framework.org/][docs].\n\n---\n\n# Funding\n\nREST
        framework is a *collaboratively funded project*. If you use\nREST framework
        commercially we strongly encourage you to invest in its\ncontinued development
        by [signing up for a paid plan][funding].\n\nThe initial aim is to provide
        a single full-time position on REST framework.\n*Every single sign-up makes
        a significant impact towards making that possible.*\n\n[![][sentry-img]][sentry-url]\n[![][stream-img]][stream-url]\n[![][spacinov-img]][spacinov-url]\n[![][retool-img]][retool-url]\n[![][bitio-img]][bitio-url]\n[![][posthog-img]][posthog-url]\n[![][cryptapi-img]][cryptapi-url]\n[![][fezto-img]][fezto-url]\n\nMany
        thanks to all our [wonderful sponsors][sponsors], and in particular to our
        premium backers, [Sentry][sentry-url], [Stream][stream-url], [Spacinov][spacinov-url],
        [Retool][retool-url], [bit.io][bitio-url], [PostHog][posthog-url], [CryptAPI][cryptapi-url],
        and [FEZTO][fezto-url].\n\n---\n\n# Overview\n\nDjango REST framework is a
        powerful and flexible toolkit for building Web APIs.\n\nSome reasons you might
        want to use REST framework:\n\n* The [Web browsable API][sandbox] is a huge
        usability win for your developers.\n* [Authentication policies][authentication]
        including optional packages for [OAuth1a][oauth1-section] and [OAuth2][oauth2-section].\n*
        [Serialization][serializers] that supports both [ORM][modelserializer-section]
        and [non-ORM][serializer-section] data sources.\n* Customizable all the way
        down - just use [regular function-based views][functionview-section] if you
        don''t need the [more][generic-views] [powerful][viewsets] [features][routers].\n*
        [Extensive documentation][docs], and [great community support][group].\n\nThere
        is a live example API for testing purposes, [available here][sandbox].\n\n**Below**:
        *Screenshot from the browsable API*\n\n![Screenshot][image]\n\n----\n\n# Requirements\n\n*
        Python 3.6+\n* Django 4.1, 4.0, 3.2, 3.1, 3.0\n\nWe **highly recommend** and
        only officially support the latest patch release of\neach Python and Django
        series.\n\n# Installation\n\nInstall using `pip`...\n\n    pip install djangorestframework\n\nAdd
        `''rest_framework''` to your `INSTALLED_APPS` setting.\n```python\nINSTALLED_APPS
        = [\n    ...\n    ''rest_framework'',\n]\n```\n\n# Example\n\nLet''s take
        a look at a quick example of using REST framework to build a simple model-backed
        API for accessing users and groups.\n\nStartup up a new project like so...\n\n    pip
        install django\n    pip install djangorestframework\n    django-admin startproject
        example .\n    ./manage.py migrate\n    ./manage.py createsuperuser\n\n\nNow
        edit the `example/urls.py` module in your project:\n\n```python\nfrom django.contrib.auth.models
        import User\nfrom django.urls import include, path\nfrom rest_framework import
        routers, serializers, viewsets\n\n\n# Serializers define the API representation.\nclass
        UserSerializer(serializers.HyperlinkedModelSerializer):\n    class Meta:\n        model
        = User\n        fields = [''url'', ''username'', ''email'', ''is_staff'']\n\n\n#
        ViewSets define the view behavior.\nclass UserViewSet(viewsets.ModelViewSet):\n    queryset
        = User.objects.all()\n    serializer_class = UserSerializer\n\n\n# Routers
        provide a way of automatically determining the URL conf.\nrouter = routers.DefaultRouter()\nrouter.register(r''users'',
        UserViewSet)\n\n# Wire up our API using automatic URL routing.\n# Additionally,
        we include login URLs for the browsable API.\nurlpatterns = [\n    path('''',
        include(router.urls)),\n    path(''api-auth/'', include(''rest_framework.urls'',
        namespace=''rest_framework'')),\n]\n```\n\nWe''d also like to configure a
        couple of settings for our API.\n\nAdd the following to your `settings.py`
        module:\n\n```python\nINSTALLED_APPS = [\n    ...  # Make sure to include
        the default installed apps here.\n    ''rest_framework'',\n]\n\nREST_FRAMEWORK
        = {\n    # Use Django''s standard `django.contrib.auth` permissions,\n    #
        or allow read-only access for unauthenticated users.\n    ''DEFAULT_PERMISSION_CLASSES'':
        [\n        ''rest_framework.permissions.DjangoModelPermissionsOrAnonReadOnly'',\n    ]\n}\n```\n\nThat''s
        it, we''re done!\n\n    ./manage.py runserver\n\nYou can now open the API
        in your browser at `http://127.0.0.1:8000/`, and view your new ''users'' API.
        If you use the `Login` control in the top right corner you''ll also be able
        to add, create and delete users from the system.\n\nYou can also interact
        with the API using command line tools such as [`curl`](https://curl.haxx.se/).
        For example, to list the users endpoint:\n\n    $ curl -H ''Accept: application/json;
        indent=4'' -u admin:password http://127.0.0.1:8000/users/\n    [\n        {\n            \"url\":
        \"http://127.0.0.1:8000/users/1/\",\n            \"username\": \"admin\",\n            \"email\":
        \"admin@example.com\",\n            \"is_staff\": true,\n        }\n    ]\n\nOr
        to create a new user:\n\n    $ curl -X POST -d username=new -d email=new@example.com
        -d is_staff=false -H ''Accept: application/json; indent=4'' -u admin:password
        http://127.0.0.1:8000/users/\n    {\n        \"url\": \"http://127.0.0.1:8000/users/2/\",\n        \"username\":
        \"new\",\n        \"email\": \"new@example.com\",\n        \"is_staff\": false,\n    }\n\n#
        Documentation & Support\n\nFull documentation for the project is available
        at [https://www.django-rest-framework.org/][docs].\n\nFor questions and support,
        use the [REST framework discussion group][group], or `#restframework` on libera.chat
        IRC.\n\nYou may also want to [follow the author on Twitter][twitter].\n\n#
        Security\n\nPlease see the [security policy][security-policy].\n\n[build-status-image]:
